CREATE DEFINER=`root`@`localhost` PROCEDURE `ORD_GenerateCoupon`(
	IN p_times INT,
    IN p_rate DECIMAL(5,3),
    IN p_description VARChAR(255),
    IN p_expiry_date DATE
)
BEGIN
	DECLARe counter INT DEFAULT 0;
    DECLARE v_coupon_code VARCHAR(255);

	WHILE counter < p_times DO
		SET v_coupon_code =  UPPER(SUBSTRING(MD5(RAND()), 1, 20));
        INSERT INTO coupon (coupon_code,rate,expiry_date,coupon_description) VALUES (v_coupon_code,p_rate,p_expiry_date,p_description);
        SET v_coupon_code = '';
        SET counter = counter + 1;
	END WHILE;

END ;;
DELIMITER ;
