CREATE DEFINER=`root`@`localhost` PROCEDURE `ORD_MakeOrder`(
	IN p_order_json JSON,
    IN p_coupon_code VARCHAR(255)
)
BEGIN
	DECLARE done INT DEFAULT FALSE;
    DECLARE v_order_id VARCHAR(255);
    DECLARe v_max_time TIME;
    DECLARE v_total_amount DECIMAL(10,2);
    DECLARe v_rate DECIMAL(5,3);
    DECLARE v_order_json JSON;
    DECLARe order_menu_id BIGINt;
	DECLARE cur CURSOR FOR
		SELECT 
            j.value AS full_value
        FROM JSON_TABLE(p_order_json, '$[*]' COLUMNS (
            value JSON PATH '$'
        )) AS j;
        
    DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
    DECLARE EXIT HANDLER FOR SQLEXCEPTION
    BEGIN
        ROLLBACK;
        RESIGNAL;
        SIGNAL SQLSTATE '45000'
            SET MESSAGE_TEXT = 'Failed to insert';
    END;
	START TRANSACTION;
    
    CALL ORD_GenerateNextOrderID(v_order_id);
    
    
    SELECT 
        MAX(c.max_time), SUM(c.Total_Amount) 
    INTO 
        v_max_time, v_total_amount
    FROM (

        SELECT 
			JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.Estimated_time'))AS max_time,
            JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.MenuPrice')) * JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.Purchase_Qty')) AS Total_Amount
        FROM JSON_TABLE(p_order_json, '$[*]' COLUMNS(value JSON PATH '$')) j
        WHERE JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.Purchase_Qty')) > 0
        
        UNION ALL
        
        SELECT 
            JSON_UNQUOTE(JSON_EXTRACT(a.value, '$.Estimated_time')) AS max_time,
            JSON_UNQUOTE(JSON_EXTRACT(a.value, '$.MenuPrice')) * JSON_UNQUOTE(JSON_EXTRACT(a.value, '$.Purchase_Qty')) AS Total_Amount
        FROM JSON_TABLE(p_order_json, '$[*]' COLUMNS(value JSON PATH '$')) j,
             JSON_TABLE(j.value, '$.AddsOnPurchase[*]' COLUMNS(value JSON PATH '$')) a
        WHERE JSON_UNQUOTE(JSON_EXTRACT(a.value, '$.Purchase_Qty')) > 0
        
        UNION ALL 
        

        SELECT 
			JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.Estimated_time')) AS max_time,
            JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.VariantPurchased.Variant_price')) * JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.VariantPurchased.Purchase_Qty')) AS Total_Amount
        FROM JSON_TABLE(p_order_json, '$[*]' COLUMNS(value JSON PATH '$')) j
        WHERE JSON_CONTAINS_PATH(j.value, 'one', '$.VariantPurchased') 
        AND JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.VariantPurchased.Purchase_Qty')) > 0
    ) AS c;
    
    IF p_coupon_code IS NOT NULL AND LOWER(p_coupon_code) != 'null' AND p_coupon_code != '' THEN
        SELECT rate INTO v_rate FROM coupon WHERE coupon_code = p_coupon_code AND used != 'Used';
        IF v_rate IS NOT NULL THEN
            SET v_total_amount = v_total_amount - (v_total_amount * v_rate);
        END IF;
    END IF;
    

    SET v_total_amount = v_total_amount + (v_total_amount * 0.12); -- 0.12 kay fixed tax
    
    INSERT INTO orders (order_id,estimated_max_time,available_until,total_amount) VALUES (v_order_id,COALESCE(v_max_time,'00:00:00'),DATE_ADD(NOW(), INTERVAL 30 MINUTE), v_total_amount);
	
    IF p_coupon_code IS NOT NULL AND LOWER(p_coupon_code) != 'null' AND p_coupon_code != '' THEN
        INSERT INTO order_coupon (coupon_code, order_id) VALUES (p_coupon_code, v_order_id);
        UPDATE coupon SET used = 'Used' WHERE coupon_code = p_coupon_code;
    END IF;
    
    OPEN cur;
    read_loop : LOOP
		FETCH cur INTO v_order_json;
		IF done THEN
			LEAVE read_loop;
		END IF;
        
			IF JSON_UNQUOTE(JSON_EXTRACT(v_order_json,'$.MenuType')) IN ('Dishes','Combo','Appetizer') THEN
				INSERT INTO order_menu (menu_id,quantity,order_id) VALUES
				(JSON_UNQUOTE(JSON_EXTRACT(v_order_json,'$.MenuID')), 
				JSON_UNQUOTE(JSON_EXTRACT(v_order_json,'$.Purchase_Qty')),
				v_order_id);
				SET order_menu_id = LAST_INSERT_ID();
				
				IF JSON_CONTAINS_PATH(v_order_json, 'one', '$.AddsOnPurchase') THEN
					INSERT INTO order_menu_sides (order_menu_id, addon_id, quantity)
					SELECT
						order_menu_id,
						CAST(JSON_UNQUOTE(JSON_EXTRACT(s.value, '$.Addon_id')) AS UNSIGNED),
						CAST(JSON_UNQUOTE(JSON_EXTRACT(s.value, '$.Purchase_Qty')) AS UNSIGNED)
					FROM JSON_TABLE(
						v_order_json,
						'$.AddsOnPurchase[*]' COLUMNS (
							value JSON PATH '$'
						)
					) AS s;
			END IF;
            
            IF JSON_CONTAINS_PATH(v_order_json, 'one', '$.RemovedIngredient') THEN
				INSERT INTO customer_customized (order_menu_id,ingredient_id)
				SELECT
					order_menu_id,
					CAST(JSON_UNQUOTE(JSON_EXTRACT(r.value, '$.IngredientID')) AS UNSIGNED)
					FROM JSON_TABLE(
					v_order_json,
					'$.RemovedIngredient[*]' COLUMNS (
						value JSON PATH '$'
					)
				) AS r;
			END IF;
        END IF;
        
        IF JSON_UNQUOTE(JSON_EXTRACT(v_order_json,'$.MenuType')) = 'Beverage' THEN
			IF JSON_CONTAINS_PATH(v_order_json, 'one', '$.VariantPurchased') THEN
				INSERT INTO order_beverage (beverage_variant_id, quantity, order_id)
				VALUES (
					CAST(JSON_UNQUOTE(JSON_EXTRACT(v_order_json, '$.VariantPurchased.VariantID')) AS UNSIGNED),
					CAST(JSON_UNQUOTE(JSON_EXTRACT(v_order_json, '$.VariantPurchased.Purchase_Qty')) AS UNSIGNED),
					v_order_id
				);
			END IF;
        END IF;	
    
		IF JSON_UNQUOTE(JSON_EXTRACT(v_order_json,'$.MenuType')) = 'Dessert' THEN
			IF JSON_CONTAINS_PATH(v_order_json, 'one', '$.VariantPurchased') THEN
				INSERT INTO order_dessert_variant (dessert_variant_id, quantity, order_id)
				VALUES (
					CAST(JSON_UNQUOTE(JSON_EXTRACT(v_order_json, '$.VariantPurchased.VariantID')) AS UNSIGNED),
					CAST(JSON_UNQUOTE(JSON_EXTRACT(v_order_json, '$.VariantPurchased.Purchase_Qty')) AS UNSIGNED),
					v_order_id
				);
			END IF;
        END IF;
        
        IF JSON_UNQUOTE(JSON_EXTRACT(v_order_json,'$.MenuType')) = 'Addon' THEN
			INSERT INTO order_addon (addon_id, quantity, order_id)
			VALUES (
				CAST(JSON_UNQUOTE(JSON_EXTRACT(v_order_json, '$.Addon_id')) AS UNSIGNED),
				CAST(JSON_UNQUOTE(JSON_EXTRACT(v_order_json, '$.Purchase_Qty')) AS UNSIGNED),
				v_order_id
			);
        END IF;
  
		
  END LOOP;
    CLOSE cur;
  
    
    
    COMMIT;
END ;;
DELIMITER ;
/*!50003 SET sql_mode              = @saved_sql_mode */ ;
/*!50003 SET character_set_client  = @saved_cs_client */ ;
/*!50003 SET character_set_results = @saved_cs_results */ ;
/*!50003 SET collation_connection  = @saved_col_connection */ ;
