CREATE DEFINER=`root`@`localhost` PROCEDURE `Z_MaxOrderBeverage`(
	IN p_cart_json JSON,
	IN p_target_product_id BIGINT
)
BEGIN
    DECLARE done INT DEFAULT FALSE;
    DECLARE v_menu_id BIGINT;
    DECLARE v_purchase_quantity BIGINT;
    DECLARE v_full_value JSON;
    
	DECLARE cur CURSOR FOR
        SELECT 
           CAST(
			  JSON_UNQUOTE(
				COALESCE(
				  JSON_EXTRACT(j.value, '$.MenuID'),
				  JSON_EXTRACT(j.value, '$.Addon_id')
				)
			  ) AS UNSIGNED
			) AS Menu_ID,
            CAST(JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.Purchase_Qty')) AS UNSIGNED),
            j.value AS full_value
        FROM JSON_TABLE(p_cart_json, '$[*]' COLUMNS (
            value JSON PATH '$'
        )) AS j;
        

	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
    
	DROP TABLE IF EXISTS temp_reserved_variant;
	DROP TABLE IF EXISTS reserved_totals_v;
    CREATE TEMPORARY TABLE temp_reserved_variant (
       beverage_variant_id BIGINT,
        reserved_quantity INT
    );
    
	OPEN cur;
    read_loop: LOOP
        FETCH cur INTO v_menu_id, v_purchase_quantity, v_full_value;
        IF done THEN
            LEAVE read_loop;
        END IF;
        
        
		IF JSON_UNQUOTE(JSON_EXTRACT(v_full_value, '$.MenuType')) = 'Beverage' THEN
			 IF JSON_CONTAINS_PATH(v_full_value, 'one', '$.VariantPurchased') THEN
                INSERT INTO temp_reserved_variant (beverage_variant_id, reserved_quantity)
                VALUES (
                    JSON_UNQUOTE(JSON_EXTRACT(v_full_value, '$.VariantPurchased.VariantID')),
                  JSON_UNQUOTE(JSON_EXTRACT(v_full_value, '$.VariantPurchased.Purchase_Qty'))
                );
            END IF;
		END IF;
         
        IF JSON_UNQUOTE(JSON_EXTRACT(v_full_value, '$.MenuType')) = 'Combo' THEN
            INSERT INTO temp_reserved_variant (beverage_variant_id, reserved_quantity)
            SELECT 
                cp.beverage_variant_id,
                (cd.quantity * v_purchase_quantity) AS total_variant_quantity
            FROM combo c 
            INNER JOIN combo_detail cd ON cd.combo_id = c.combo_id
            INNER JOIN combo_beverage cp ON cp.combo_detail_id = cd.combo_detail_id
            WHERE c.menu_id = v_menu_id;
	
			IF JSON_CONTAINS_PATH(v_full_value, 'one', '$.VariantPurchased') THEN
				INSERT INTO temp_reserved_variant (beverage_variant_id, reserved_quantity)
				VALUES (
					JSON_UNQUOTE(JSON_EXTRACT(v_full_value, '$.VariantPurchased.VariantID')),
					JSON_UNQUOTE(JSON_EXTRACT(v_full_value, '$.VariantPurchased.Purchase_Qty'))
				);
			END IF;
		
		END IF;

        
	END LOOP;
    CLOSE cur;

   
	CREATE TEMPORARY TABLE reserved_totals_v AS
	SELECT beverage_variant_id, SUM(total) AS total
	FROM (
		SELECT beverage_variant_id, SUM(reserved_quantity) AS total FROM temp_reserved_variant GROUP BY beverage_variant_id
		UNION ALL
		SELECT rcp.beverage_variant_id, SUM(rcp.reserved_quantity) AS total FROM reserved_combo_beverage rcp GROUP BY rcp.beverage_variant_id
		UNION ALL
		SELECT rp.beverage_variant_id, SUM(rp.reserved_quantity) AS total FROM reserved_beverage rp GROUP BY rp.beverage_variant_id
	) AS un
	GROUP BY beverage_variant_id;
    
    SELECT
        COALESCE(
        GREATEST(
            COALESCE(pv.current_stock, 0) - COALESCE(rtv.total, 0),
            0
        ),0) AS max_order
    FROM beverage_variant pv
    LEFT JOIN reserved_totals_v rtv ON pv.beverage_variant_id = rtv.beverage_variant_id
    WHERE pv.beverage_variant_id = p_target_product_id;
    
    DROP TABLE IF EXISTS temp_reserved_variant;
	DROP TABLE IF EXISTS reserved_totals_v;
END ;;
