					WHERE bd.dessert_variant_id = JSON_UNQUOTE(JSON_EXTRACT(v_full_value, '$.VariantPurchased.VariantID'));
				END IF;
		END IF;
        

		IF JSON_UNQUOTE(JSON_EXTRACT(v_full_value, '$.MenuType')) = 'Addon' THEN
			 INSERT INTO temp_reserved (ingredient_id, reserved_quantity)
				SELECT 
                    ai.ingredient_id,
                    ai.quantity * v_purchase_quantity
                FROM addon a
                INNER JOIN addon_ingredient ai ON ai.addon_id = a.addon_id
                WHERE a.addon_id = v_menu_id;
        END IF;
	
        
          IF JSON_CONTAINS_PATH(v_full_value, 'one', '$.AddsOnPurchase') THEN
			INSERT INTO temp_reserved (ingredient_id, reserved_quantity)
			SELECT 
				ai.ingredient_id,
				ai.quantity * CAST(JSON_UNQUOTE(JSON_EXTRACT(ax.value, '$.Purchase_Qty')) AS UNSIGNED)
			FROM 
			JSON_TABLE(
				v_full_value,
				'$.AddsOnPurchase[*]' COLUMNS (
						value JSON PATH '$'
				)
			) AS ax
			INNER JOIN addon_ingredient ai ON ai.addon_id = JSON_UNQUOTE(JSON_EXTRACT(ax.value, '$.Addon_id'));
		END IF;

    END LOOP;
    CLOSE cur;
    
	CREATE TEMPORARY TABLE reserved_totals AS
    SELECT ingredient_id, SUM(total) AS total
	FROM (
		SELECT tr.ingredient_id, SUM(tr.reserved_quantity) AS total FROM temp_reserved tr GROUP BY tr.ingredient_id
		UNION ALL
		SELECT ra.ingredient_id, SUM(ra.reserved_ingredient) AS total FROM reserved_addon ra GROUP BY ra.ingredient_id
		UNION ALL
		SELECT ra2.ingredient_id, SUM(ra2.reserved_ingredient) AS total FROM reserved_appetizer ra2 GROUP BY ra2.ingredient_id
		UNION ALL
		SELECT rd.ingredient_id, SUM(rd.reserved_ingredient) AS total FROM reserved_dishes rd GROUP BY rd.ingredient_id
        UNION ALL 
        (
			SELECT ingredient_id, SUM(reserved_ingredient) as total FROM reserved_combo_appetizer GROUP BY ingredient_id
			UNION ALL
			SELECT ingredient_id, SUM(reserved_ingredient) as total FROM reserved_combo_dishes GROUP BY ingredient_id
        )
        UNION ALL 
        SELECT rd.ingredient_id, SUM(rd.reserved_ingredient) AS total FROM reserved_dessert rd GROUP BY rd.ingredient_id
	) AS un
	GROUP BY ingredient_id;

    CREATE TEMPORARY TABLE reserved_totals_v AS
	SELECT beverage_variant_id, SUM(total) AS total
	FROM (
		SELECT beverage_variant_id, SUM(reserved_quantity) AS total FROM temp_reserved_variant GROUP BY beverage_variant_id
		UNION ALL
		SELECT rcp.beverage_variant_id, SUM(rcp.reserved_quantity) AS total FROM reserved_combo_beverage rcp GROUP BY rcp.beverage_variant_id
		UNION ALL
		SELECT rp.beverage_variant_id, SUM(rp.reserved_quantity) AS total FROM reserved_beverage rp GROUP BY rp.beverage_variant_id
	) AS un
	GROUP BY beverage_variant_id;

    
    
    CREATE TEMPORARY TABLE target_ingredients AS
    SELECT 
        ci.ingredient_id,
        total_ingredient_quantity
	FROM a_retrieve_combo_ingredients ci
	WHERE ci.menu_id = p_target_menu_id;
    
	CREATE TEMPORARY TABLE target_variants AS
    SELECT 
        cp.beverage_variant_id, 
        cd.quantity AS quantity_per_combo
    FROM combo c 
    INNER JOIN combo_detail cd ON cd.combo_id = c.combo_id
    INNER JOIN combo_beverage cp ON cp.combo_detail_id = cd.combo_detail_id
    WHERE c.menu_id = p_target_menu_id;

	CREATE TEMPORARY TABLE max_order_ingredient AS
    SELECT 
            GREATEST(MIN(
                FLOOR(
                    (COALESCE(stock.current_stock, 0) - COALESCE(rt.total, 0)) / ti.total_ingredient_quantity
                )
				)  
            ,0)max_order
    FROM target_ingredients ti
    LEFT JOIN (
        SELECT ingredient_id, SUM(current_stock) AS current_stock
        FROM ingredient_stock
        WHERE expiry_date > NOW()
        GROUP BY ingredient_id
    ) AS stock ON ti.ingredient_id = stock.ingredient_id
    LEFT JOIN reserved_totals rt ON ti.ingredient_id = rt.ingredient_id;
    

    CREATE TEMPORARY TABLE max_order_variant AS
    SELECT
		GREATEST(MIN(
			FLOOR(
				(COALESCE(pv.current_stock, 0) - COALESCE(trv.total, 0)) / tv.quantity_per_combo
			)
		), 0)
         max_order
    FROM target_variants tv
    LEFT JOIN beverage_variant pv ON tv.beverage_variant_id = pv.beverage_variant_id
    LEFT JOIN reserved_totals_v trv ON tv.beverage_variant_id = trv.beverage_variant_id;


    SELECT MIN(max_order) AS max_order FROM (
	  SELECT max_order FROM max_order_ingredient
	  UNION ALL
	  SELECT max_order FROM max_order_variant
	) AS all_orders
	WHERE max_order IS NOT NULL;
    

	DROP TEMPORARY TABLE IF EXISTS target_variants;
    DROP TEMPORARY TABLE IF EXISTS target_ingredients;
	DROP TEMPORARY TABLE IF EXISTS temp_reserved;
    DROP TEMPORARY TABLE IF EXISTS temp_reserved_variant;
    DROP TEMPORARY TABLE IF EXISTS reserved_totals_v;
    DROP TEMPORARY TABLE IF EXISTS reserved_totals;
    DROP TEMPORARY TABLE IF EXISTS max_order_variant;
    DROP TEMPORARY TABLE IF EXISTS max_order_ingredient;
END ;;
