CREATE DEFINER=`root`@`localhost` PROCEDURE `Z_MaxOrderDishes`(
	IN p_cart_json JSON,
    IN p_target_menu_id BIGINT
)
BEGIN
	DECLARE done INT DEFAULT FALSE;
    DECLARE v_json_value JSON;
    DECLARE v_menu_id BIGINT;
    DECLARE v_purchase_qty BIGINT;
    
    DECLARE cur CURSOR FOR
        SELECT 
			CAST(
			  JSON_UNQUOTE(
				COALESCE(
				  JSON_EXTRACT(j.value, '$.MenuID'),
				  JSON_EXTRACT(j.value, '$.Addon_id')
				)
			  ) AS UNSIGNED
			) AS Menu_ID,
            CAST(JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.Purchase_Qty')) AS UNSIGNED) as Purchase_Qty,
            j.value AS full_value
        FROM JSON_TABLE(p_cart_json, '$[*]' COLUMNS (
            value JSON PATH '$'
        )) AS j
      WHERE JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.MenuID')) IS NOT NULL OR JSON_UNQUOTE(JSON_EXTRACT(j.value, '$.Addon_id')) IS NOT NULL;
        
	DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
	DROP TEMPORARY TABLE IF EXISTS temp_reserved;
    CREATE TEMPORARY TABLE temp_reserved (
        ingredient_id BIGINT,
        reserved_quantity DECIMAL(10,2)
    );

	OPEN cur;
	read_loop1 : LOOP
		FETCH cur INTO v_menu_id,v_purchase_qty,v_json_value;
		IF done THEN
			LEAVE read_loop1;
		END IF;
	
        IF JSON_UNQUOTE(JSON_EXTRACT(v_json_value, '$.MenuType')) != 'Beverage' THEN  
        
			IF JSON_UNQUOTE(JSON_EXTRACT(v_json_value, '$.MenuType')) = 'Dishes' THEN
				INSERT INTO temp_reserved (ingredient_id, reserved_quantity)
				SELECT di.ingredient_id, di.quantity * v_purchase_qty
				FROM dishes d 
				INNER JOIN dishes_ingredient di ON di.dishes_id = d.dishes_id
				WHERE d.menu_id = v_menu_id;
            END IF;
            
			IF JSON_UNQUOTE(JSON_EXTRACT(v_json_value, '$.MenuType')) = 'Combo' THEN
				INSERT INTO temp_reserved (ingredient_id, reserved_quantity)
				SELECT ci.ingredient_id, ci.total_ingredient_quantity * v_purchase_qty
				FROM a_retrieve_combo_ingredients ci WHERE ci.menu_id = v_menu_id; 
            END IF;
            
            IF JSON_UNQUOTE(JSON_EXTRACT(v_json_value, '$.MenuType')) = 'Appetizer' THEN
				INSERT INTO temp_reserved (ingredient_id, reserved_quantity)
				SELECT di.ingredient_id, di.quantity * v_purchase_qty
				FROM appetizers d 
				INNER JOIN appetizer_ingredient di ON di.appetizer_id = d.appetizer_id
				WHERE d.menu_id = v_menu_id;
            END IF;
            
            -- for bevarage dessert ingredients
			IF JSON_UNQUOTE(JSON_EXTRACT(v_json_value, '$.MenuType')) IN ('Dessert') THEN
				IF JSON_CONTAINS_PATH(v_json_value, 'one', '$.VariantPurchased') THEN
					INSERT INTO temp_reserved (ingredient_id, reserved_quantity)
					SELECT 
						bi.ingredient_id,
						bi.quantity * JSON_UNQUOTE(JSON_EXTRACT(v_json_value, '$.VariantPurchased.Purchase_Qty'))
					FROM dessert_variant bd
					INNER JOIN dessert_ingredient bi ON bi.dessert_variant_id = bd.dessert_variant_id
					WHERE bd.dessert_variant_id = JSON_UNQUOTE(JSON_EXTRACT(v_json_value, '$.VariantPurchased.VariantID'));
				END IF;
			END IF;
            
            -- for addon-sides
			IF JSON_CONTAINS_PATH(v_json_value, 'one', '$.AddsOnPurchase') THEN
				INSERT INTO temp_reserved (ingredient_id, reserved_quantity)
				SELECT 
					ai.ingredient_id,
					ai.quantity * CAST(JSON_UNQUOTE(JSON_EXTRACT(ax.value, '$.Purchase_Qty')) AS UNSIGNED)
				FROM 
				JSON_TABLE(
					v_json_value,
					'$.AddsOnPurchase[*]' COLUMNS (
							value JSON PATH '$'
					)
				) AS ax
				INNER JOIN addon_ingredient ai ON ai.addon_id = JSON_UNQUOTE(JSON_EXTRACT(ax.value, '$.Addon_id'));
			END IF;
            
			IF JSON_UNQUOTE(JSON_EXTRACT(v_json_value, '$.MenuType')) = 'Addon' THEN
					INSERT INTO temp_reserved (ingredient_id, reserved_quantity)
					SELECT 
						ai.ingredient_id,
						ai.quantity * JSON_UNQUOTE(JSON_EXTRACT(v_json_value, '$.Purchase_Qty'))
					FROM addon a
					INNER JOIN addon_ingredient ai ON ai.addon_id = a.addon_id
					WHERE ai.addon_id = JSON_UNQUOTE(JSON_EXTRACT(v_json_value, '$.Addon_id'));
			END IF;
            
        END IF;
    END LOOP;
    CLOSE cur;
    
    DROP TEMPORARY TABLE IF EXISTS reserved_totals;
    CREATE TEMPORARY TABLE reserved_totals AS
	SELECT ingredient_id, SUM(total) AS total
	FROM (
		SELECT tr.ingredient_id, SUM(tr.reserved_quantity) AS total FROM temp_reserved tr GROUP BY tr.ingredient_id
		UNION ALL
		SELECT ra.ingredient_id, SUM(ra.reserved_ingredient) AS total FROM reserved_addon ra GROUP BY ra.ingredient_id
		UNION ALL
		SELECT ra2.ingredient_id, SUM(ra2.reserved_ingredient) AS total FROM reserved_appetizer ra2 GROUP BY ra2.ingredient_id
		UNION ALL
		SELECT rd.ingredient_id, SUM(rd.reserved_ingredient) AS total FROM reserved_dishes rd GROUP BY rd.ingredient_id
        UNION ALL 
        (
			SELECT ingredient_id, SUM(reserved_ingredient) as total FROM reserved_combo_appetizer GROUP BY ingredient_id
			UNION ALL
			SELECT ingredient_id, SUM(reserved_ingredient) as total FROM reserved_combo_dishes GROUP BY ingredient_id
        )
       UNION ALL 
        SELECT rd.ingredient_id, SUM(rd.reserved_ingredient) AS total FROM reserved_dessert rd GROUP BY rd.ingredient_id
	) AS un
	GROUP BY ingredient_id;

    
    DROP TEMPORARY TABLE IF EXISTS target_ingredient;
    CREATE TEMPORARY TABLE target_ingredient AS
    SELECT di.ingredient_id, di.quantity
    FROM dishes d
    INNER JOIN dishes_ingredient di ON di.dishes_id = d.dishes_id
    WHERE d.menu_id = p_target_menu_id;
    
	SELECT 
        CASE WHEN COUNT(*) = 0 THEN 0
		ELSE 
			GREATEST(MIN(FLOOR(
            	(COALESCE(stock.current_stock, 0) - COALESCE(rt.total, 0)) / NULLIF(ti.quantity, 0)
			)), 0)

        END AS max_order
	FROM target_ingredient ti
	LEFT JOIN (
        SELECT iss.ingredient_id,i.unit, SUM(iss.current_stock) AS current_stock
        FROM ingredient_stock iss
        INNER JOIN ingredients i ON i.ingredient_id = iss.ingredient_id
        WHERE expiry_date > NOW()
        GROUP BY ingredient_id
    ) stock ON ti.ingredient_id = stock.ingredient_id
    LEFT JOIN reserved_totals rt ON rt.ingredient_id = ti.ingredient_id;
    
    DROP TEMPORARY TABLE IF EXISTS temp_reserved;
	DROP TEMPORARY TABLE IF EXISTS target_ingredient;
    DROP TEMPORARY TABLE IF EXISTS reserved_totals;
END ;;
